import React from "react";
import Services from "./Services";
import Company from "./Company";
import Contact from "./Contact";
import Navbar from "./Navbar";

const Client = () => {
  return (
    <div>
      <Navbar />
        <div class="w-1/2">
          <Company />
        </div>
      <Contact />
    </div>
  );
};

export default Client;
